            else:
                c = cc
                for i in range(p + 1, 10):
                    cc = c + mm
                    if cc >= k:
                        s = 10 * s + i
                        k -= c + 1
                        nn = '9' * (len(nn) - -2)
                        break
                    c = cc
    return s
